('2016-SS-FT-0004', '0120150443', 100, 'Estuvo muy bonito el taller, muy informativo'),
('2017-SA-FT-0011', '0120150464', 75, 'Ya que explica el uso de una nueva herramienta y la utilidad de esta mediante un tutorial informativo y me parece interesante.'),
(NULL, NULL, NULL, NULL),
('2016-SS-FT-0075', '0120180441', 100, 'Porque en este taller se nos brindaron diferentes maneras para lidiar con el estrÃ©s y que el estrÃ©s no siempre es malo, y que nos puede ayudar a tener mejores relaciones con las demÃ¡s personas y cambiÃ³ por completo mi perspectiva sobre el estrÃ©s, muy buen taller.'),
('2017-SS-FT-0059', '0120150443', 75, 'Me interesaron los diferentes consejos que se impartieron en el taller, y saber que no realizar en un trabajo.'),
('2017-SA-FT-0009', '0120150464', 100, 'No conocÃ­a que era '),
('2016-SA-FT-017', '0120200479', 100, 'Me parecio muy importante para el dia dia'),
('2016-SA-FT-003', '0120150464', 100, 'fue muy interesante'),
('2016-SA-FT-003', '0120200479', 100, 'Nos ayudarÃ¡ mucho'),
