('2016-SA-FT-055', '0120160420', 100, 'Me ayudÃ³ mucho a conocerme y aprender a moderar mis impulsos'),
('2016-SA-FT-055', '0120200479', 100, 'Me ayudÃ³ a identificar que no solo importa la actitud que tengas sino tambiÃ©n como la proyectas a los demÃ¡s.'),
('2016-SA-FT-052', '0120270412', 100, 'El tema fue interesante.'),
('2016-SA-FT-061', '0120270412', 100, 'Me pareciÃ³ interesante el contenido del video.'),
('2015-SS-FT-0054', '0120290448', 75, 'Me gusta que actualmente pueda tomar mis talleres desde el paÃ­s en que me encuentro. Si bien me he mantenido auto-informado siempre es bueno poder discutir de otros temas.'),
('2016-SS-FT-0111', '0120290448', 100, 'InformaciÃ³n muy interesante y acertada.'),
('2017-SA-FT-0021', '0120040535', 100, 'estuvo muy informativo\r\n'),
('2017-SS-FT-0059', '0120040550', 100, 'Me enseÃ±o maneras correctas de poder aplicar esta herramienta '),
('2017-SS-FT-0061', '0120040550', 100, 'Por que me pareciÃ³ muy bueno el tema, la verdad que si deja muy claro lo que quiere informar y muy adecuado a la situaciÃ³n que estamos pasando, que los trabajos son necesario para subsistir y poder tener fondos en la casa, y si es de las maneras que justo pensÃ© al menos en mi Ã¡rea de mi carrera si explicaba como trabajar y los demÃ¡s trabajos y es de ayuda para trabajar en esta situaciÃ³n que como paÃ­s estÃ¡ pasando y asÃ­ poder mantener al lugar de trabajo activo.'),
('2017-SS-FT-0073', '0120040550', 100, 'Es un taller muy Ãºtil con un enfoque contemporaneo y apegado a la realidad que vivimos en la actualidad'),
('2016-SS-FT-0044', '0120110548', 100, 'Me gusto mucho, ya que aprendÃ­ a ser mÃ¡s cuidadosa en el uso de mis redes sociales'),
('2016-SA-FT-0038', '0120110590', 100, 'Es muy prÃ ctico para informarnos sobre el momento que estamos pasando, de esta manera, podemos estar preparados para lo que nos venga en el futuro'),
('2016-SS-FT-0056', '0120110593', 100, 'Muy completo ya que incentivÃ³ a la participaciÃ³n de la familia y al anÃ¡lisis de algo que no se suele pensar como los ingresos y egresos.'),
('2016-SS-FT-0056', '0120110584', 100, 'El contenido fue muy acertado y conciso, me gustÃ³ mucho el ejercicio de como se implementarÃ­a en el mundo laboral.'),
('2016-SS-FT-0056', '0120180598', 100, 'Muy interesante los tips, y me pareciÃ³ muy acertado, de igual forma me gustÃ³ el aspecto en que se elaboren los contenidos mediante presentaciones explicadas en forma de vÃ­deo.'),
('2016-SS-FT-0089', '0120180539', 100, 'Me puso a pensar sobre el contraste de las habilidades que se requieren en estos diferentes escenarios de la vida'),
('2015-SS-FT-0105', '0120110593', 75, 'Fue bastante util la informaciÃ³n proporcionada, pero me hubiese gustado que hubieran habido mas tips o formas de optimizar al maximo nuestros ingresos y administrar de mejor manera nuestros egresos.'),
('2017-SS-FT-0059', '0120110593', 75, 'M e ayudo mucho y me permitio aplicarlo en mi vida'),
('2016-SS-FT-0004', '0120040550', 100, 'Muy interesante el tema'),
('2016-SS-FT-0004', '0120110584', 100, 'Es un tema muy importante que me ayudara en el futuro venidero'),
('2016-SS-FT-0004', '0120180598', 100, 'Excelentes consejos para nuestra primera experiencia laboral\r\n'),
('2017-SS-FT-0079', '0120110548', 100, 'Muy buen taller, muy informativo y al punto a la hora de explicar los diferentes conceptos del taller '),
('2017-SS-FT-0079', '0120110584', 75, 'Muy buen taller, aunque me pareciÃ³ un poco confusa la pregunta del taller (usar la creatividad para conseguir un trabajo post-cuarentena sino mal recuerdo)'),
('2017-SS-FT-0079', '0120180586', 100, 'Super acertada la informaciÃ³n y actualizada a estos tiempos'),
('2017-SS-FT-0073', '0120110593', 100, 'Es una temÃ¡tica muy impotante en estos tiempos principalmente porquÃ© es en este momento donde las finanzas de todas las familias de escasos recursos nos vemos criticamente afectadas por lo que es importante saber administrar de forma correcta los pocos recursos con los que contamos al mismo tiempo que buscar soluciones que puedan ayudar a obtener ingresos desde casa'),
('2017-SS-FT-0073', '0120180539', 100, 'Debemos tener muy en cuenta nuestras debilidades pero al mismo tiempo debemos estar consientes de nuestras virtudes como individuos es por ello que considero importante este taller porquÃ© me brinda una perspectiva mÃ¡s amplia sobre las aptitudes que debo de desarrolloar para ser un mejor profesional.'),
('2016-SS-FT-0034', '0120180598', 100, 'El material era muy bueno, muy completo y bastante bien resumido. Era muy fÃ¡cil de captar las ideas y de tomarlas en cuenta para nuestro plan.'),
('2016-SS-FT-0004', '0120080646', 100, 'Estuvo intersante y muy informativo'),
('2017-SS-FT-0030', '0120150692', 100, 'MUy buen taller, porque nos hace tener mÃ¡s conciencia del porque gastamos de mas y que hacer para dejar de hacerlo.'),
('2017-SS-FT-0061', '0120010638', 100, 'Porque aprendÃ­ algo que no sabÃ­a una nueva forma de encontrar trabajo y asÃ­ poder laborar, cosas que nadie se imaginaba a utilizar y me gustÃ³ el taller en realidad que son cosas que se aprenden en el camino que si no es por alguien uno se queda con lo mismo y nos ayuda a salir adelante enfrentando las nuevas cosas que suceden. '),
('2015-SS-FT-0022', '0120150617', 75, 'Creo que debido a la situaciÃ³n del COVID-19 y todos los cambios que causÃ³ en el Ã¡rea laboral, es una buena forma para hacer networking y conseguir oportunidades laborales en la llamada \"Nueva Normalidad\". Me gustÃ³ que nos mostrarÃ¡n tÃ¡cticas y ejemplos concretos de buenas prÃ¡cticas y los tutoriales para como hacer un perfil que se alinea a lo que buscan los reclutadores.'),
('2015-SS-FT-0022', '0120080651', 100, 'Este taller fue un motivante para finalmente empezar a aprender cosas que tenÃ­a pendiente desde hace tiempo, siempre enfocadas en mi carrera y que ahora se han vuelto mÃ¡s relevantes por el tema del COVID-19. La informaciÃ³n fue certera y motivante.'),
('2016-SA-FT-052', '0120150675', 75, '-'),
('2016-SA-FT-052', '0120220611', 100, '-'),
('2016-SS-FT-0044', '0120150692', 100, 'La temÃ¡tica es muy buena, ya que me ayudo a identificar los gastos innecesarios que aveces inconscientemente lo hacemos, y que ahora tratare de no cometerlos mÃ¡s');
