('20208427', 40, '2019-12-10', '2019-12-20', 'Stephanie Aldana', 'Actividades realizadas: \r\n- GestiÃ³n de duelo en madres y padres. \r\n- Terapia LÃºdica: por medio del juego se creaba un espacio donde los y las niÃ±as podÃ­an depositar sus emociones emergentes de su estadÃ­a en el hospital. \r\n- DesinfecciÃ³n de juguetes. \r\n- RealizaciÃ³n de dinÃ¡micas integradoras.   ', '20208427.jpeg', '01-2020', '2015-SS-FT-0053', 'Aprobado', 'Aprobado'),
('20208545', 15, '2020-03-06', '2020-03-31', 'Karla MarÃ­a Castro de Tobar ', 'Mis horas de vinculaciÃ³n se basaron en estar ayudando a alumnos de segundo y tercer grado del Centro Escolar CatÃ³lico JesÃºs Obrero en el turno vespertino en el Ã¡rea de lectura y escritura para que estos tuvieran mejor desempeÃ±o acadÃ©mico.', '20208545.pdf', '01-2020', '2017-SS-FT-0071', 'Aprobado', 'Aprobado'),
('20208816', 40, '2020-04-22', '2020-05-07', 'Emerson Vladimir Oporto Segura.', 'Se apoyÃ³ en actualizaciÃ³n de base de datos de estudiantes de nuevo ingreso y el seguimiento del proceso de personas interesadas en matricularse en la Universidad para el ciclo 02-2020, ademÃ¡s se apoyÃ³ en la recopilaciÃ³n de informaciÃ³n para la elaboraciÃ³n de material para la fanpage del Observatorio Micro Macro - UDB. ', '20208816.pdf', '01-2020', '2016-SS-FT-0056', 'Aprobado', 'Aprobado'),
('20208957', 22, '2020-02-07', '2020-02-11', 'Doris Jeannette Granados Granados', 'ElaboraciÃ³n de un mural principal del mes de Febrero y con el valor del mes.\r\nElaboraciÃ³n de un mural mÃ¡s pequeÃ±o siempre refiriÃ©ndose al mes de febrero. ', '20208957.jpeg', '01-2020', '2017-SA-FT-0019', 'Aprobado', 'Se aprueban 22 horas'),
('20208962', 40, '2020-02-10', '2020-06-22', 'Wilson Ramirez', 'Le ayudaba al T. Wilson a calificar las actividades de  los niÃ±os nivela de forma presencial y ahora virtual. TambiÃ©n le ayude a ordenar en el aula al inicio del aÃ±o.', '20208962.jpg', '01-2020', '2017-SS-FT-0043', 'Aprobado', 'Aprobado'),
