('20209319', 40, '2020-02-08', '2020-02-08', 'ROTARACT-ESEN', 'RealicÃ© la limpieza de una de las quebradas importantes en la ciudad de Santa Tecla. Quitamos toda la basura, cortamos la maleza y destapamos los lugares que estaban obstruidos.', '20209319.pdf', '01-2020', '2017-SA-FT-0010', 'Rechazado', 'La captura de pantalla dice que se realizaron 42 horas en un solo dÃ­a fecha de inicio y fin es la misma por favor solicitar. Constancia o correo a las autoridades para validar la cantidad de horas.'),
