('20209419', 40, '2020-02-11', '2020-03-11', 'Lic. Milton JosuÃ© MartÃ­nez', 'ElaboraciÃ³n de material didÃ¡ctico para actividades de fomento a la lectura.\r\nProceso fÃ­sico de los libros: limpieza, forrado e inventario.\r\nApoyo en la campaÃ±a de limpieza pre-Plogging en el marco de la CelebraciÃ³n del XVI Festival Cultural David Granadino.', '20209419.pdf', '01-2020', '2017-SA-FT-0036', 'Aprobado', 'Se aprueban horas para ciclo 1-2020'),
