('20209528', 9, '2020-02-21', '2020-03-06', 'Victor Dahbura ', 'En el desarrollo de las horas de vinculaciÃ³n apoye al docente Victor dahbura en el desarrollo de las clases correspondientes a la materia InglÃ©s. De la misma forma, participe activamente en la revisiÃ³n de actividades evaluadas con la supervisiÃ³n del docente en cuestiÃ³n.', '20209528.png', '01-2020', '2017-SS-FT-0073', 'Aprobado', 'Aprobado'),
('20209557', 40, '2020-05-09', '2020-06-06', 'John H. MÃ©ndez', 'Participaba en conferencias medioambientales: Juventudes, ODS, Cambio ClimÃ¡tico, El acuerdo de EscazÃº y Green Deal en Europa.\r\nRealize un test para demostrar lo aprendido.\r\n*Solo se realizaron actividades virtuales por la crisis que pasamos actualmente del COVID-19.', '20209557.jpg', '01-2020', '2017-SS-FT-0081', 'Aprobado', 'Aprobado'),
('20209712', 40, '2020-02-17', '2020-03-14', 'Julio Ernesto DÃ­az', 'Servicio social en 2 lugares. \r\n-Cancha Colonia \"BoquÃ­n\". 3:00 pm-5:00 pm. 32 niÃ±os.\r\n-Cancha Colonia \"Montecasino\". 5:00 pm-7:00 pm. 23 niÃ±os.\r\n\r\nActividades realizadas:\r\n-Control de asistencia \r\n-Sacar y guardar el equipo de trabajo\r\n-Arbitrar los partidos\r\n-CampaÃ±a de limpieza en ambas canchas\r\n-Lavar los chalecos de entrenamiento\r\n-DigitalizaciÃ³n de papelerÃ­a\r\n-Sacar copias de formatos', '20209712.pdf', '01-2020', '2017-SS-FT-0023', 'Aprobado', 'Aprobado');
