INSERT INTO `preguntas` (`id`, `pregunta`, `respuesta`, `fechaRespuesta`) VALUES
(47, 'Â¿CÃ³mo me tengo que registrar en Moodle?', 'En la landing page de Workeys encontrarÃ¡s un botÃ³n llamado â€œtutoriales Workeysâ€. AhÃ­ encontrarÃ¡s el video tutorial con las indicaciones de cÃ³mo tendrÃ¡s que hacer tu registro en Moodle.', '2020-09-9 12:27'),
(48, 'Â¿En quÃ© meses me puedo registrar?', 'Solamente se abre inscripciones en los meses de enero y julio de cada aÃ±o ', '2020-09-10 12:27'),
(49, 'Â¿CuÃ¡nto dura la CertificaciÃ³n Workeys?', 'Dura 9 meses, pero si dejas un mÃ³dulo te retrasas y la duraciÃ³n se extenderÃ¡. ', '2020-09-11 12:27'),
(50, 'Â¿QuÃ© pasa si no me inscribo?', 'Tu beca podrÃ­a ser condicionada, revocada o podrÃ­as perder el apoyo que recibes por parte de la fundaciÃ³n.', '2020-09-11 12:28'),
(51, 'Â¿QuÃ© tengo que hacer si no me inscribo?', 'Redactar un correo dirigido a MÃ³nica de GÃ¡lvez y Keny MÃ¡rquez, en donde expongas los motivos por los cuales no pudiste inscribirte. Ellas analizarÃ¡n caso por caso y sÃ­ tu caso de no inscripciÃ³n se considera validado serÃ¡s notificado ', '2020-09-11 12:29'),
(52, 'Â¿QuÃ© pasa si dejo un mÃ³dulo?', 'Tu beca podrÃ­a ser condicionada, revocada o podrÃ­as perder el apoyo que recibes por parte de la fundaciÃ³n.', '2020-09-1 12:29'),
(53, 'Â¿CuÃ¡l es la nota mÃ­nima para aprobar cada mÃ³dulo de la certificaciÃ³n?', 'La nota mÃ­nima es 8.5, toda nota menor a esta se considera reprobado', '2020-09-11 12:30'),
(54, 'Â¿Por quÃ© debo cursar la certificaciÃ³n?', '-Porque aprenderÃ¡s lo que estÃ¡ demandando actualmente el mercado laboral \r\n-SerÃ¡ un requisito para aplicar a la bolsa de empleo Oportunidades. \r\n-Es un requisito obligatorio para mantener tu beca y/o apoyo que recibes por parte de la fundaciÃ³n.\r\n', '2020-07-11 12:30'),
(55, 'Â¿Por quÃ© tengo que cursar la certificaciÃ³n para aplicar a la Bolsa de Empleo Oportunidades?', 'Porque con la certificaciÃ³n el coach tiene seguridad que has visto y aprendido el contenido que es importante para desempeÃ±arte laboralmente. ', '2020-09-11 12:30'),
(56, 'Â¿QuÃ© porcentajes representan las actividades de mi nota final?', 'El trabajo final un 55%\r\nEl promedio de la nota de los talleres 35%\r\nLos foros de cada semana 15%', '2020-07-11 12:31');
