INSERT INTO `solicituddesinscribir` (`id_solicitud`, `id_alumno`, `id_taller`, `comentario`, `comprobante`, `Comentario2`, `estado`, `Fecha`, `fechaFin`) VALUES
(20201292, '2017-SA-FT-0006', '0120270412', 'Buenos dÃ­as\r\nSÃ­, lo realice ese mismo dÃ­a a las 10:00pm, aÃºn es valido asÃ­?', '20201292.pdf', 'Si, si tu respuesta fue de acorde al tema se te contarÃ¡ ', 'Rechazado', NULL, NULL),
(20202517, '2017-SA-FT-0019', '0120280554', 'El motivo es porque hoy hace una hora me mandaron un correo que tenia clase-vÃ­deo a las 3:00 y el taller esta para las 3:00 segÃºn workeys oportunidades esta para esa hora en instagram; mi intenciÃ³n era hacer el taller pero por motivos de un clase ', '20202517.pdf', '', 'En espera', NULL, NULL),
(20202562, '2016-SS-FT-0076', '0120220635', 'En estos momentos me siento deprimida, acaba de morir mi abuelo estoy en su funeral, estoy afrontando el duelo y no tengo cabeza para esto.\r\nDespuÃ©s les adjuntare o les harÃ© llegar el acta de defunciÃ³n. ', '20202562.jpeg', '', 'En espera', NULL, NULL),
(20202646, '2017-SA-FT-0047', '0120160379', 'Tengo entrega de proyecto ese dÃ­a en clase de PsicologÃ­a de 10:55 a 12:35', '20202646.pdf', 'Fue aprobado ', 'Aprobado', NULL, NULL),
(20203813, '2015-SS-FT-0054', '0120110548', 'Durante el progreso de la semana pasada estuve realizando el proceso de movilizacion a otro cuarto, ya que me encuentro en Nicaragua y los procesos de repractiÃ³n se volvieron un poco mas complejos. Dicha movilizacion me dejo sin conexion y bastante ', '20203813.png', 'Ok, Wilfredo, gracias por comunicarte con nosotros y brindarnos la evidencia necesaria.', 'Aprobado', NULL, NULL),
(20204556, '2017-SA-FT-0006', '0120180516', 'Lo seleccione por accidente, las disculpas del caso', '20204556.pdf', 'Ten mÃ¡s cuidado Blanca. tambiÃ©n recuerda que debes completar 15 talleres para tu renovaciÃ³n e beca', 'Rechazado', NULL, NULL),
(20205475, '2017-SA-FT-0011', '0120160420', 'QuerÃ­a informar que no pude entrar al taller de este dÃ­a ya que no tu ve luz en mi casa, por consecuente no tuve internet. Y hace poco acaba de regresar, en si solo escribo este mensaje en son de una justificaciÃ³n, ademÃ¡s querÃ­a preguntar porque', '20205475.pdf', 'Comprendemos, gracias por notificar tu falta', 'Aprobado', NULL, NULL),
(20205831, '2016-SS-FT-0017', '0120220468', 'Tengo inscritos 4 talleres, cuando solamente deberÃ­an ser 3.', '20205831.pdf', 'Si hay espacio, puedes inscribirte en el mes a mÃ¡s de 3 talleres, pero en teorÃ­a el permiso para inscribirte a mÃ¡s de 3 talleres se activa cuando termina el perÃ­odo oficial de inscripciÃ³n.', 'Aprobado', NULL, NULL),
(20206399, '2012-SA-FT-0048', '0120180516', 'Porque inscribÃ­ un taller demÃ¡s del lÃ­mite permitido', '20206399.pdf', 'No hay problema, puedes inscribir talleres de mÃ¡s siempre y cuano aÃºn exista cupo. AsÃ­ que puedes realizarlo y si lo haces bien te contarÃ¡ como un taller mÃ¡s. ', 'Rechazado', NULL, NULL),
(20206595, '2015-SA-FT-015', '0120010698', 'La Ãºltima vez que realicÃ© los talleres tenÃ­a hasta el dÃ­a miÃ©rcoles para poder dar mi respuesta, creÃ­ que esa era la manera que lo iban a estar manejando, aunque entraba en conflicto con el tiempo que se habÃ­a estipulado de las 2 horas me pare', '20206595.pdf', '', 'En espera', NULL, NULL),
(20206764, '2015-SS-FT-0054', '0120110584', 'Durante el progreso de la semana pasada estuve realizando el proceso de movilizacion a otro cuarto, ya que me encuentro en Nicaragua y los procesos de repractiÃ³n se volvieron un poco mas complejos. Dicha movilizacion me dejo sin conexion y bastante ', '20206764.png', 'Solo trata de ponerte al dÃ­a mÃ¡s adelante.', 'Aprobado', NULL, NULL),
(20207123, '2017-SS-FT-0076', '0120180539', 'El motivo es porque ese dÃ­a ya tengo un taller a esa hora ', '20207123.pdf', 'Recuerda que tienes hasta el miÃ©rcoles para poder realizar tus talleres. es decir, puedn tener la misma fecha y hora, pero siempre tendrÃ¡s hasta los miÃ©rcoles para realizarlos. No te preocupes', 'Rechazado', NULL, NULL),
(20207674, '2017-SA-FT-0055', '0120110369', 'No podrÃ© asistir ya que mis clases ese dÃ­a finalizan a las 10:55 y tengo actividad evaluada de inglÃ©s.', '20207674.pdf', 'Fue aprobado ', 'Aprobado', NULL, NULL),
(20207921, '2015-SA-FT-015', '0120040545', 'QuerÃ­a reponer el taller que perdÃ­ hace una semana con otro de esta semana, pero no vi bien la fecha y este ya no estÃ¡ disponible.', '20207921.png', 'ok, ten mÃ¡s cuidado a la proxima.', 'Aprobado', NULL, NULL),
(20207926, '2017-SA-FT-0040', '0120040545', 'Fue un error de dedo a la hora de revisar mis talleres, ya que la fecha ya habÃ­a pasado, no es que estuviera inscrita desde antes.', '20207926.pdf', 'Gracias por notificarnos. Porfavor ten mÃ¡s cuidado, porque ese tipo de excusas no se permiten. seremos flexibles estÃ¡ vez', 'Aprobado', NULL, NULL),
